script: |
  super -f text -I q6032.spq | sort > q6032.out

inputs:
  - name: q6032.spq
    data: |
      SELECT DISTINCT col1 / + - 92 + - ( - col2 ), 3 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE - 96 < col0;
  - name: tab1

outputs:
  - name: q6032.out
    data: |
      59	3
      68	3
      96	3
